### YamlMime:TSType
name: ModelResult
uid: botbuilder-dialogs.ModelResult
package: botbuilder-dialogs
summary: Outer result returned by an entity recognizer like `recognizeChoices()`.
fullName: ModelResult<T>
remarks: >-
  This structure is wrapped around the recognized result and contains
  [start](#start) and

  [end](#end) position information to identify the span of text in the users
  utterance that was

  recognized. The actual result can be accessed through the
  [resolution](#resolution) property.
isDeprecated: false
type: interface
properties:
