    uid: botbuilder-dialogs.ModelResult.end
    package: botbuilder-dialogs
    summary: End character position of the recognized substring.
    fullName: end
    remarks: ''
    isDeprecated: false
    syntax:
      content: 'end: number'
      return:
        description: ''
        type: number
  - name: resolution
    uid: botbuilder-dialogs.ModelResult.resolution
